import React from "react";

const Work = () => {
  return (
    <Wrapper>
      <WorkContent>
        <h2>Work</h2>
        <Website>
          <h3>website</h3>
          <p>仮想サイトの制作</p>
          <p>01</p>
          <p>02</p>
        </Website>

        <h3>app</h3>
        <p>Reactを用いたアプリの制作</p>
        <p>01</p>
        <h3>practice</h3>
        <p>その他、模写コーディングなど</p>
      </WorkContent>
    </Wrapper>
  );
};

export default Work;
